import Navbar from './Navbar';
import Home from './Home';
import {BrowserRouter as Router,Routes } from 'react-router-dom'

function App() {

  return (
    <Router>
      <div className="App">
        <Navbar/>
        <div className="content">
          <Route path = "/">
            <Home/>
          </Route>
        </div>
      </div>
    </Router>
  );
}

export default App;
